"use strict";(self.webpackChunkblog_demo=self.webpackChunkblog_demo||[]).push([[420],{4135:(s,n,a)=>{a.r(n),a.d(n,{data:()=>p});const p={key:"v-62e92bf6",path:"/issue/git.html",title:"Git",lang:"zh-CN",frontmatter:{date:"2021/11/26 20:37",title:"Git",description:"记录的是本所遇到的bug",tag:["git"]},excerpt:"",headers:[{level:2,title:"Git报错:“ERROR: Permission to XXX.git denied to user”",slug:"git报错-error-permission-to-xxx-git-denied-to-user",children:[]}],git:{updatedTime:null,contributors:[]}}},5800:(s,n,a)=>{a.r(n),a.d(n,{default:()=>o});const p=(0,a(6252).uE)('<div class="custom-container tip"><p class="custom-container-title">TIP</p><p>记录的是本所遇到的bug</p></div><h2 id="git报错-error-permission-to-xxx-git-denied-to-user" tabindex="-1"><a class="header-anchor" href="#git报错-error-permission-to-xxx-git-denied-to-user" aria-hidden="true">#</a> Git报错:“ERROR: Permission to XXX.git denied to user”</h2><h4 id="解决方案" tabindex="-1"><a class="header-anchor" href="#解决方案" aria-hidden="true">#</a> 解决方案</h4><ul><li>1、生成一个新的SSH KEY</li></ul><div class="language-ruby ext-rb line-numbers-mode"><pre class="language-ruby"><code>AppledeiMac<span class="token operator">:</span><span class="token operator">~</span> Apple$ cd <span class="token operator">~</span><span class="token operator">/</span><span class="token punctuation">.</span>ssh\n<span class="token symbol">AppledeiMac</span><span class="token operator">:</span><span class="token punctuation">.</span>ssh Apple$ ls\nid_rsa        id_rsa<span class="token punctuation">.</span>pub  known_hosts\n<span class="token symbol">AppledeiMac</span><span class="token operator">:</span><span class="token punctuation">.</span>ssh Apple$ ssh<span class="token operator">-</span>keygen <span class="token operator">-</span>t rsa <span class="token operator">-</span><span class="token constant">C</span> <span class="token string-literal"><span class="token string">&quot;iMac_personnal_publicKey&quot;</span></span>\nGenerating <span class="token keyword">public</span><span class="token operator">/</span><span class="token keyword">private</span> rsa key pair<span class="token punctuation">.</span>\nEnter file <span class="token keyword">in</span> which to save the key <span class="token punctuation">(</span><span class="token operator">/</span>Users<span class="token regex-literal"><span class="token regex">/Apple/</span></span><span class="token punctuation">.</span>ssh<span class="token operator">/</span>id_rsa<span class="token punctuation">)</span><span class="token operator">:</span>               \n<span class="token operator">/</span>Users<span class="token regex-literal"><span class="token regex">/Apple/</span></span><span class="token punctuation">.</span>ssh<span class="token operator">/</span>id_rsa_personal\nEnter passphrase <span class="token punctuation">(</span>empty <span class="token keyword">for</span> no passphrase<span class="token punctuation">)</span><span class="token operator">:</span> \nEnter same passphrase again<span class="token operator">:</span> \nYour identification has been saved <span class="token keyword">in</span> <span class="token operator">/</span>Users<span class="token regex-literal"><span class="token regex">/Apple/</span></span><span class="token punctuation">.</span>ssh<span class="token operator">/</span>id_rsa_personal<span class="token punctuation">.</span>\nYour <span class="token keyword">public</span> key has been saved <span class="token keyword">in</span> <span class="token operator">/</span>Users<span class="token regex-literal"><span class="token regex">/Apple/</span></span><span class="token punctuation">.</span>ssh<span class="token operator">/</span>id_rsa_personal<span class="token punctuation">.</span>pub<span class="token punctuation">.</span>\nThe key fingerprint is<span class="token operator">:</span>\n<span class="token symbol">SHA256</span><span class="token operator">:</span><span class="token number">1</span>gepuxDHwJRnFbKvc0Zq<span class="token operator">/</span>NGrFGE9kEXS06jxatPPrSQ iMac_personnal_publicKey\nThe key&#39;s randomart image is<span class="token operator">:</span>\n<span class="token operator">+</span><span class="token operator">-</span><span class="token operator">-</span><span class="token operator">-</span><span class="token punctuation">[</span><span class="token constant">RSA</span> <span class="token number">2048</span><span class="token punctuation">]</span><span class="token operator">-</span><span class="token operator">-</span><span class="token operator">-</span><span class="token operator">-</span><span class="token operator">+</span>\n<span class="token operator">|</span>      <span class="token operator">...</span><span class="token punctuation">.</span><span class="token operator">=</span><span class="token operator">*</span>oo   <span class="token operator">|</span>\n<span class="token operator">|</span>     o<span class="token punctuation">.</span> ooo<span class="token operator">=</span><span class="token operator">+</span> <span class="token punctuation">.</span>  <span class="token operator">|</span>\n<span class="token operator">|</span>      oo<span class="token punctuation">.</span> <span class="token operator">=</span><span class="token operator">+</span>o<span class="token punctuation">.</span>   <span class="token operator">|</span>\n<span class="token operator">|</span>       o <span class="token operator">=</span><span class="token punctuation">.</span>o<span class="token operator">..</span>   <span class="token operator">|</span>\n<span class="token operator">|</span>      <span class="token punctuation">.</span> <span class="token constant">S</span> <span class="token operator">=</span>o<span class="token punctuation">.</span>    <span class="token operator">|</span>\n<span class="token operator">|</span>       <span class="token operator">=</span> <span class="token operator">=</span><span class="token operator">+</span><span class="token operator">+</span><span class="token punctuation">.</span>    <span class="token operator">|</span>\n<span class="token operator">|</span>      <span class="token punctuation">.</span> <span class="token constant">B</span><span class="token punctuation">.</span><span class="token operator">=</span><span class="token punctuation">.</span>Eo<span class="token operator">..</span> <span class="token operator">|</span>\n<span class="token operator">|</span>       o <span class="token constant">B</span> <span class="token punctuation">.</span> <span class="token operator">+</span>o <span class="token punctuation">.</span><span class="token operator">|</span>\n<span class="token operator">|</span>          <span class="token punctuation">.</span> o<span class="token operator">..</span> <span class="token operator">..</span> <span class="token operator">|</span>\n<span class="token operator">+</span><span class="token operator">-</span><span class="token operator">-</span><span class="token operator">-</span><span class="token operator">-</span><span class="token punctuation">[</span><span class="token constant">SHA256</span><span class="token punctuation">]</span><span class="token operator">-</span><span class="token operator">-</span><span class="token operator">-</span><span class="token operator">-</span><span class="token operator">-</span><span class="token operator">+</span>\n<span class="token symbol">AppledeiMac</span><span class="token operator">:</span><span class="token punctuation">.</span>ssh Apple$ ls\nid_rsa            id_rsa_personal     known_hosts\nid_rsa<span class="token punctuation">.</span>pub        id_rsa_personal<span class="token punctuation">.</span>pub`\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br><span class="line-number">13</span><br><span class="line-number">14</span><br><span class="line-number">15</span><br><span class="line-number">16</span><br><span class="line-number">17</span><br><span class="line-number">18</span><br><span class="line-number">19</span><br><span class="line-number">20</span><br><span class="line-number">21</span><br><span class="line-number">22</span><br><span class="line-number">23</span><br><span class="line-number">24</span><br><span class="line-number">25</span><br><span class="line-number">26</span><br><span class="line-number">27</span><br><span class="line-number">28</span><br></div></div><ul><li>2、打开新生成的~/.ssh/id_rsa2.pub文件，将里面的内容添加到GitHub后台。</li><li>3、打开~/.ssh/config文件 没有config文件则创建，终端输入touch config ，创建完以后用Vim打开或者是在Finder打开一样。 在不影响默认的github设置下我们重新添加一个Host： 建一个自己能辨识的github别名，我取的是github-personal，新建的帐号使用这个别名做克隆和更新</li></ul><div class="language-ruby ext-rb line-numbers-mode"><pre class="language-ruby"><code>Host github<span class="token operator">-</span>personal\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p>HostName github.com User git IdentityFile ~/.ssh/id_rsa_personal</p><p>编辑完毕之后按下ESC，:wq，:wq是保存并退出vim编辑器 具体在终端代码如下： cat config 是把config文件里面的内容在终端输出 AppledeiMac:.ssh Apple$ vim config AppledeiMac:.ssh Apple$ cat config</p><div class="language-ruby ext-rb line-numbers-mode"><pre class="language-ruby"><code>  <span class="token comment">#Default GitHub</span>\n  Host github<span class="token punctuation">.</span>com\n  HostName github<span class="token punctuation">.</span>com\n  User git\n  IdentityFile <span class="token operator">~</span><span class="token operator">/</span><span class="token punctuation">.</span>ssh<span class="token operator">/</span>id_rsa\n\n  Host github<span class="token operator">-</span>personal\n  HostName github<span class="token punctuation">.</span>com\n  User git\n  IdentityFile <span class="token operator">~</span><span class="token operator">/</span><span class="token punctuation">.</span>ssh<span class="token operator">/</span>id_rsa_personal\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br></div></div><ul><li>4、将GitHub SSH仓库地址中的git@github.com替换成新建的Host别名。 如原地址是 git@github.com:hbxn740150254/BestoneGitHub.git 替换后应该是：github-personal:hbxn740150254/BestoneGitHub.git 或者git@github-personal:hbxn740150254/BestoneGitHub.git亲测都是可以的， 如果是新建的仓库，直接使用替换后的URL克隆即可。如果已经使用原地址克隆过了，可以使用命令修改：</li></ul><div class="language-ruby ext-rb line-numbers-mode"><pre class="language-ruby"><code>AppledeiMac<span class="token operator">:</span><span class="token punctuation">.</span>ssh Apple$ cd <span class="token operator">/</span>Users<span class="token operator">/</span>Apple<span class="token operator">/</span>Desktop<span class="token operator">/</span>BestoneDemo \n<span class="token operator">/</span><span class="token operator">/</span>修改之前\nApple$ git remote <span class="token operator">-</span>v\ngithub  git<span class="token variable">@github</span><span class="token punctuation">.</span>com<span class="token symbol">:hbxn740150254</span><span class="token operator">/</span>BestoneGitHub<span class="token punctuation">.</span>git <span class="token punctuation">(</span>fetch<span class="token punctuation">)</span>\ngithub  git<span class="token variable">@github</span><span class="token punctuation">.</span>com<span class="token symbol">:hbxn740150254</span><span class="token operator">/</span>BestoneGitHub<span class="token punctuation">.</span>git <span class="token punctuation">(</span>push<span class="token punctuation">)</span>\n<span class="token operator">/</span><span class="token operator">/</span>修改 remote set<span class="token operator">-</span>url\n<span class="token symbol">AppledeiMac</span><span class="token symbol">:BestoneDemo</span> Apple$ git remote set<span class="token operator">-</span>url github  github<span class="token operator">-</span> personal<span class="token symbol">:hbxn740150254</span><span class="token operator">/</span>BestoneGitHub<span class="token punctuation">.</span>git\n<span class="token operator">/</span><span class="token operator">/</span>验证是否修改成功    \n<span class="token operator">/</span><span class="token operator">/</span>使用修改后的github<span class="token operator">-</span>personal <span class="token constant">SSH</span>连接，连接成功用户是hbxn740150254，此时公钥是id_rsa_personal\n<span class="token symbol">AppledeiMac</span><span class="token symbol">:BestoneDemo</span> Apple$ ssh <span class="token operator">-</span><span class="token constant">T</span> github<span class="token operator">-</span>personal\nHi hbxn740150254<span class="token operator">!</span> You&#39;ve successfully authenticated<span class="token punctuation">,</span> but GitHub does <span class="token keyword">not</span> provide shell access<span class="token punctuation">.</span>\n<span class="token operator">/</span><span class="token operator">/</span>使用默认的git<span class="token variable">@github</span><span class="token punctuation">.</span>com <span class="token constant">SSH</span>去连接<span class="token punctuation">,</span>连接成功用户是FaxeXian，此时公钥是id_rsa\n<span class="token symbol">AppledeiMac</span><span class="token operator">:</span><span class="token punctuation">.</span>ssh Apple$ ssh <span class="token operator">-</span><span class="token constant">T</span> git<span class="token variable">@github</span><span class="token punctuation">.</span>com\nHi FaxeXian<span class="token operator">!</span> You&#39;ve successfully authenticated<span class="token punctuation">,</span> but GitHub does <span class="token keyword">not</span> provide shell access<span class="token punctuation">.</span>\n<span class="token operator">/</span><span class="token operator">/</span>修改之后\n<span class="token symbol">AppledeiMac</span><span class="token symbol">:BestoneDemo</span> Apple$ git remote <span class="token operator">-</span>v\ngithub  github<span class="token operator">-</span>personal<span class="token symbol">:hbxn740150254</span><span class="token operator">/</span>BestoneGitHub<span class="token punctuation">.</span>git <span class="token punctuation">(</span>fetch<span class="token punctuation">)</span>\ngithub  github<span class="token operator">-</span>personal<span class="token symbol">:hbxn740150254</span><span class="token operator">/</span>BestoneGitHub<span class="token punctuation">.</span>git <span class="token punctuation">(</span>push<span class="token punctuation">)</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br><span class="line-number">13</span><br><span class="line-number">14</span><br><span class="line-number">15</span><br><span class="line-number">16</span><br><span class="line-number">17</span><br><span class="line-number">18</span><br></div></div><p>最后我们进行正常的push，fetch 操作，都可以</p><div class="language-ruby ext-rb line-numbers-mode"><pre class="language-ruby"><code><span class="token operator">/</span><span class="token operator">/</span>更改后的github push成功！\n<span class="token symbol">AppledeiMac</span><span class="token symbol">:BestoneDemo</span> Apple$ git push github testMerge<span class="token symbol">:master</span>\nTotal <span class="token number">0</span> <span class="token punctuation">(</span>delta <span class="token number">0</span><span class="token punctuation">)</span><span class="token punctuation">,</span> reused <span class="token number">0</span> <span class="token punctuation">(</span>delta <span class="token number">0</span><span class="token punctuation">)</span>\nTo github<span class="token operator">-</span>personal<span class="token symbol">:hbxn740150254</span><span class="token operator">/</span>BestoneGitHub<span class="token punctuation">.</span>git\n cd773e9<span class="token operator">..</span>f622210  testMerge <span class="token operator">-</span><span class="token operator">&gt;</span> master\n\n<span class="token operator">/</span><span class="token operator">/</span>github默认的节点origin我们也可以正常push操作\n<span class="token symbol">AppledeiMac</span><span class="token symbol">:BestoneDemo</span> Apple$ git push origin testMerge<span class="token symbol">:testMerge</span>\nCounting objects<span class="token operator">:</span> <span class="token number">460</span><span class="token punctuation">,</span> done<span class="token punctuation">.</span>\nDelta compression using up to <span class="token number">4</span> threads<span class="token punctuation">.</span>\nCompressing objects<span class="token operator">:</span> <span class="token number">100</span><span class="token operator">%</span> <span class="token punctuation">(</span><span class="token number">240</span><span class="token operator">/</span><span class="token number">240</span><span class="token punctuation">)</span><span class="token punctuation">,</span> done<span class="token punctuation">.</span>\nWriting objects<span class="token operator">:</span> <span class="token number">100</span><span class="token operator">%</span> <span class="token punctuation">(</span><span class="token number">460</span><span class="token regex-literal"><span class="token regex">/460), 16.69 MiB | 442.00 KiB/s</span></span><span class="token punctuation">,</span> done<span class="token punctuation">.</span>\nTotal <span class="token number">460</span> <span class="token punctuation">(</span>delta <span class="token number">211</span><span class="token punctuation">)</span><span class="token punctuation">,</span> reused <span class="token number">453</span> <span class="token punctuation">(</span>delta <span class="token number">205</span><span class="token punctuation">)</span>\nTo git<span class="token variable">@git</span><span class="token punctuation">.</span>coding<span class="token punctuation">.</span>net<span class="token symbol">:hbxn740150254</span><span class="token operator">/</span>Local<span class="token operator">-</span>Git<span class="token punctuation">.</span>git\n<span class="token operator">*</span> <span class="token punctuation">[</span><span class="token keyword">new</span> branch<span class="token punctuation">]</span>      testMerge <span class="token operator">-</span><span class="token operator">&gt;</span> testMerge\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br><span class="line-number">13</span><br><span class="line-number">14</span><br><span class="line-number">15</span><br></div></div><p>github账户如果还是显示之前id_rsa密钥账户的话请把你的密钥加入sshAgent代理中</p><ul><li>添加你的ssh密钥到ssh-agent中</li></ul><div class="language-ruby ext-rb line-numbers-mode"><pre class="language-ruby"><code><span class="token comment"># start the ssh-agent in the background</span>\neval <span class="token string-literal"><span class="token string">&quot;$(ssh-agent -s)&quot;</span></span>\nAgent pid <span class="token number">59566</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br></div></div><ul><li>如果你的密钥不是系统默认的RSA文件名id_rsa，比如像我一样另外创了一对公钥/密钥id_rsa_personal，那么就把他们添加进去，注意：密钥文件是不带扩展名的，公钥扩展名是.pub，代表publicKey，</li></ul><div class="language-ruby ext-rb line-numbers-mode"><pre class="language-ruby"><code>apple<span class="token operator">:</span><span class="token punctuation">.</span>ssh apple$ eval <span class="token string-literal"><span class="token string">&quot;$(ssh-agent -s)&quot;</span></span>\nAgent pid <span class="token number">19795</span>\n<span class="token operator">/</span><span class="token operator">/</span>添加密钥 id_rsa_personal\n<span class="token symbol">apple</span><span class="token operator">:</span><span class="token punctuation">.</span>ssh apple$ ssh<span class="token operator">-</span>add id_rsa_personal\nIdentity added<span class="token operator">:</span> id_rsa_personal <span class="token punctuation">(</span>github<span class="token operator">-</span>personal<span class="token punctuation">)</span>\n<span class="token operator">/</span><span class="token operator">/</span>添加默认密钥 id_rsa\n<span class="token symbol">apple</span><span class="token operator">:</span><span class="token punctuation">.</span>ssh apple$ ssh<span class="token operator">-</span>add id_rsa\n<span class="token operator">/</span><span class="token operator">/</span>密钥有密码的话就会要你提示输入 passphrase\nEnter passphrase <span class="token keyword">for</span> id_rsa<span class="token operator">:</span> \n<span class="token operator">/</span><span class="token operator">/</span>测试用密钥isa是否连接成功github\n<span class="token symbol">apple</span><span class="token operator">:</span><span class="token punctuation">.</span>ssh apple$ ssh <span class="token operator">-</span><span class="token constant">T</span> git<span class="token variable">@github</span><span class="token punctuation">.</span>com\nHi hbxn740150254<span class="token operator">!</span> You &#39;ve successfully authenticated<span class="token punctuation">,</span> but GitHub does <span class="token keyword">not</span> provide shell access<span class="token punctuation">.</span>\n<span class="token operator">/</span><span class="token operator">/</span>测试密钥id_rsa_personal是否连接成功github\n<span class="token symbol">apple</span><span class="token operator">:</span><span class="token punctuation">.</span>ssh apple$ ssh <span class="token operator">-</span><span class="token constant">T</span> git<span class="token variable">@github</span><span class="token operator">-</span>personal\nHi FaxeXian<span class="token operator">!</span> You&#39;ve successfully authenticated<span class="token punctuation">,</span> but GitHub does <span class="token keyword">not</span> provide shell access<span class="token punctuation">.</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br><span class="line-number">13</span><br><span class="line-number">14</span><br><span class="line-number">15</span><br></div></div><p>这样，一台电脑生成的两个公钥让两个用户成功连接，就可以访问别人的远程仓库，可以进行多人开发了！！</p><p>作者：穿山甲到底说了什么</p><p>来源：简书 著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。</p>',22),e={},o=(0,a(3744).Z)(e,[["render",function(s,n){return p}]])}}]);